import {link} from "react-router-dom";
import './Navbar.css'

class Navbar extends Components{
    render(){
        return(
            <div classnam="NavbarItems">
                <h1 classname="logo">Ratz</h1>

                <ul classname="Menu">
                    <li>
                        <a>HOME</a>
                        <a>ABOUT</a>
                        <a>CONTACT US</a>
                    </li>

                </ul>

            </div>
        )
    }
} export default Navbar;
